		function treeclick( imgClicked, controlID )
		{
			var pos;
			var imgName;

			if( imgClicked.src.indexOf('img/tree_plus.gif')>0 )
			{
				document.all[controlID].style.display='block';
				pos = imgClicked.src.indexOf( 'plus.gif' );
				imgName = imgClicked.src.substring( 0, pos );
				imgName = imgName + 'minus.gif';
				imgClicked.src = imgName;	
			}
			else if( imgClicked.src.indexOf('img/tree_minus.gif')>0 )
			{
				document.all[controlID].style.display='none';
				pos = imgClicked.src.indexOf( 'minus.gif' );
				imgName = imgClicked.src.substring( 0, pos );
				imgName = imgName + 'plus.gif';
				imgClicked.src = imgName;
			}
		}

		function closelist()
		{
			top.document.all["Content"].cols="0,*";
		}
